-- create people table with id, first_name, last_name, state, birthday and add index on birthday, state

CREATE TABLE people (
    id INT NOT NULL AUTO_INCREMENT,
    first_name VARCHAR(50) NOT NULL,
    last_name VARCHAR(50) NOT NULL,
    state VARCHAR(2) NOT NULL,
    birthday DATE NOT NULL,
    PRIMARY KEY (id)
);

CREATE INDEX birthday_idx ON people (birthday);

CREATE INDEX state_idx ON people (state);

